import * as types from './../constants/ActionTypes';

export const status = () => {
    return{
        type : types.TOGGLE_STATUS,
    }
}

export const showAll = (data) => {
    return {
        type : types.SHOW_ALL,
        data
    }
}

export const showModel = (data) => {
    return {
        type : types.SHOW_MODEL,
        data
    }
}

export const showGood = () => {
    return {
        type : types.SHOW_GOOD,
    }
}
